import "./Card.scss"
import cardImage from "./Product D.png"

class Card extends Component {
    render() {


    return (

            <div className="card__box">
                <img src={cardImage} className="card__image" alt="card-images"/>
                <div className="card__name">Apollo Running</div>
                <div className="card__price">$50.00</div>
            </div>
    );
};
}

export default Card;
